import React from 'react';
import logo from '../../assets/logo.svg';
import './Home.css';

function Home() {
    return (
            <header className="App-header">
                <p>
                    Edit <code>src/App.js</code> and save to reload.
                </p>
            </header>
    );
}

export default Home;
